                                    <p>When it comes to providing education to the next generation, diverse experience counts. The founder and director of Mastery Quest, Kojo Obeng M.ED, began creating learning experiences on an island boys & girls summer camp and continued for the next two decades gaining valuable experience in before after school programs, classroom teaching in public school, private school, charters, and homeschool communities. While gaining experience in these diverse education settings, Kojo created Mastery Quest to solve many of the problems that emerge using standard outdated education models.</p>
